import PostsList from "components/PostsList";
import React from "react";
import { useInfiniteQuery } from "react-query";
import { getPost, getPosts } from "../utils/api-client";
import FollowCard from "./FollowCard";


export default function Feed() {

  const { data: posts, isLoading, isSuccess } = useInfiniteQuery("Posts", getPosts);


  console.log(posts, {isSuccess});
  return (
    <>
      <PostsList posts={posts} isLoading={isLoading} isSuccess={isSuccess}/>
      <div className="message text-info">You have reached the end!</div>
      <FollowCard
        noPop
        length={7}
        title="Follow more users to see their posts"
      />
    </>
  );
}
